          <p>2\u3001Users shall not maliciously register the website account of Digital Offers by any means, including but not limited to multiple account registration for the purpose of profit making, speculation, cash, awards, etc. Users shall not embezzle other users\u2019 accounts. If the user violates the above provisions, Digital Offers shall be entitled to directly take all necessary measures to cancel the benefits obtained due to the violation and to pursue the  legal action against the user through litigation.</p>
